import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [feedsState, setFeedsState] = useState([])
  const getFeeds = async () => {
    try {
      const feeds = await fetch('http://127.0.0.1:5002/api/v1/feeds', {
        method: 'GET',
        headers: {'Content-Type': 'application/json'},
        mode: 'cors'
      }).then(response => {
        if (!response) {
          throw new Exception()
        }
      })
      setFeedsState(feeds?.data)
    } catch (err) {
      console.error(err)
    }
  }

  useEffect(() => {
    getFeeds();
  }, [])

  return (
    <div className="App">
      <div>{feedsState.map((feed: any) => (
        <div key={feed?.resource_id}>{feed?.type}</div>
      ))}</div>
    </div>
  );
}

export default App;
